
class CfnBraceWithText {
    constructor(svg, data, config) {
        this.svg = svg;
        this.data = data;
        this.config = config;
        this.svgG         = this.svg.append('g');
        this.svgGBrace    = this.svgG.append('g');
        this.svgGTextPath = this.svgG.append('g');
        this.svgGText     = this.svgG.append('g');
        
        
        this.svgG.attr('id', this.config.id);
        this.svgGBrace.attr('id', this.config.id + 'b');
        this.svgGTextPath.attr('id', this.config.id + 'tp');
        this.svgGText.attr('id', this.config.id + 't');
        
        this.textPathId = this.config.id + 'TextPath';
        
        this.initialize();
        
        // We don't want to perform initTransform at the very start of the script, but it only needs to happen once
        this.initTransformDone = false;
    }
    
    initialize() {
        // It's a path so we append a path and add .datum. Instead of adding .data and then enter() and then append().
        this.gBrace = this.svgGBrace
            .append('path')
            .datum(this.data.brace);
           
        this.gTextPath = this.svgGTextPath
            .append('path')
            .attr("id", this.textPathId)
            .datum(this.data.textPath); 
        
        if (this.data.text[0].path) {   
            this.gText = this.svgGText
                .selectAll('text')
                .data(this.data.text)
                .enter()
                .append('text');
                // .append('textPath')
                // .attr("href", "#" + this.textPathId);
        } else {
            this.gText = this.svgGText
                .selectAll('text')
                .data(this.data.text)
                .enter()
                .append('text');

        }
    }
    
    initTransform({transition, duration, delay, speedUp, fraction, nextOn}) {
        if (!this.initTransformDone) {
            
            this.gBrace
                .attr("opacity", 0)
                .attr("fill", "none")
                .attr("stroke", this.config.braceColor ? this.config.braceColor : '#000000')
                .attr("stroke-width", 0.3)
                .attr("d", d3.line().x((d) => d.x).y((d) => d.y).curve(d3.curveCardinal)); 

            if (this.data.text[0].path) {
                // this.gTextPath
                //     .attr("opacity", 0)
                //     .attr("fill", "none")
                //     .attr("stroke", "none")
                //     .attr("stroke-width", 0.3)
                //     .attr("d", d3.line().x((d) => d.x).y((d) => d.y).curve(d3.curveBasis)); 
                // 
                // this.gText
                //     .attr("opacity", 0)
                //     .style("text-anchor", (d) => d.anchor)
                //     // .style("alignment-baseline", (d) => d.alignmentBaseline) // doesn't work with path
                //     .text((d) => d.text)
                //     .attr("startOffset", "100%")
                //     .style('font-family', this.config.fontFamily ? this.config.fontFamily : 'Gluten')
                //     .style("font-size", (d) => d.fontSize);

                var y = Math.min(this.data.brace[1].y, this.data.brace[5].y) - Math.abs(this.data.brace[1].y - this.data.brace[5].y) / 4;
                var x = this.data.brace[4].x

                this.gText
                    .attr("opacity", 0)
                    .style("text-anchor", 'middle')
                    .style("alignment-baseline", 'baseline') // doesn't work with path
                    .text((d) => d.text)
                    .attr("x", x)
                    .attr("y", y)
                    .style('font-family', this.config.fontFamily ? this.config.fontFamily : 'Gluten')
                    .style("font-size", (d) => d.fontSize);

            } else {
                this.gText
                    .attr("opacity", 0)
                    .style("text-anchor", (d) => d.anchor)
                    .style("alignment-baseline", (d) => d.alignmentBaseline)
                    .text((d) => d.text)
                    .attr("x", (d) => d.x)
                    .attr("y", (d) => d.y)
                    //.attr("startOffset", "100%")
                    .style('font-family', this.config.fontFamily ? this.config.fontFamily : 'Gluten')
                    .style("font-size", (d) => d.fontSize);
            }
            
            
            this.initTransformDone = true;
        };
    }
    
    trans1({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            
            this.gBrace
                .transition(transition + 'b')
                .delay(delay)
                .duration(duration) 
                .attr("opacity", 1);
            
            this.gText
                .transition(transition + 't')
                .delay(delay)
                .duration(duration)   
                .attr("opacity", 1)
                .on(nextOn, resolve);
               
        });
    }
    
    trans2({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            
            this.gBrace
                .transition(transition + 'b')
                .delay(delay)
                .duration(duration) 
                .attr("opacity", 0);
            
            this.gText
                .transition(transition + 't')
                .delay(delay)
                .duration(duration)   
                .attr("opacity", 0)
                .on(nextOn, resolve);
               
        });
    }
}



























class CfnCustomDrawing {
    constructor(svg, data, config) {
        this.svg = svg;
        this.data = data;
        this.config = config;
        this.svgG   = this.svg.append('g');
        //this.svgGPaths = this.svgG.append('g');
        
        this.svgG.attr('id', this.config.id);
        //this.svgGPaths.attr('id', this.config.id + 'p');
        
        
        this.initialize();
        
        // We don't want to perform initTransform at the very start of the script, but it only needs to happen once
        this.initTransformDone = false;
    }
    
    initialize() {

        this.gPaths = this.svgG
            .selectAll('path')
            .data(this.data.paths)
            .enter()
            .append('path');
    }
    
    initTransform({transition, duration, delay, speedUp, fraction, nextOn}) {
        if (!this.initTransformDone) {
            
            var x = this.data.main.x0;
            // var y = this.data.main.y0;
            var y = this.data.main.y1;
            var scale = this.data.main.scale;

            this.svgG
                .attr("transform", `translate(${x},${y}) scale(${scale})`);

            this.gPaths
                .attr("d", (d) => d.path)
                .attr("fill", (d) => d.fill)
                .attr("stroke", (d) => d.stroke)
                .attr("stroke-width", (d) => d.strokeWidth);
            
            this.initTransformDone = true;
        };
    }


    trans1({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            
            var x = this.data.main.x0 + fraction * this.config.dx;
            var y = this.data.main.y1 + fraction * this.config.dy;
            var scale = this.data.main.scale;

            const transformPromise = new Promise(resolveTransform => {
                this.svgG
                    .transition(transition + 'T')
                    .duration(duration)
                    .delay(delay)
                    .attr("transform", (d) => `translate(${x},${y}) scale(${scale})`)
                    .on(nextOn, resolveTransform);
            });

            const opacityPromise = new Promise(resolveOpacity => {
                this.gPaths
                    .transition(transition + 'O')
                    .duration(duration)
                    .delay(delay)
                    .style('opacity', (d) => 1 - fraction)
                    .on(nextOn, resolveOpacity);
            });

            // Wait for both promises to resolve
            Promise.all([transformPromise, opacityPromise]).then(resolve);
            
        });
    }

}

class CfnCustomText {
    constructor(svg, data, config) {
        this.svg    = svg;
        this.data   = data;
        this.config = config;
        this.svgG   = this.svg.append('g');
        
        
        this.svgG.attr('id', this.config.id);
        
        this.initialize();
        
        // We don't want to perform initTransform at the very start of the script, but it only needs to happen once
        this.initTransformDone = false;
    }
    
    initialize() {
    
        this.gText = this.svgG
            .selectAll('text')
            .data(this.data)
            .enter()
            .append('text');
    }
    
    initTransform({transition, duration, delay, speedUp, fraction, nextOn}) {
        if (!this.initTransformDone) {
            
            this.gText
                .attr("opacity", (d) => d.o0)
                .style("text-anchor", (d) => d.anchor)
                .style("alignment-baseline", (d) => d.alignmentBaseline)
                .style("fill", (d) => d.fill)
                .text((d) => d.text)
                .attr("x", (d) => d.x0)
                .attr("y", (d) => d.y0)
                .style('font-family', this.config.fontFamily ? this.config.fontFamily : 'Gluten')
                .style("font-size", (d) => d.fontSize);            
            
            this.initTransformDone = true;
        };
    }
    
    trans1({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            
            this.gText
                .transition(transition)
                .delay(delay)
                .duration(duration)   
                .attr("opacity", (d) => d.o0 + fraction * (d.o1 - d.o0))
                .on(nextOn, resolve);
               
        });
    }
    
    trans2({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            
            this.gText
                .transition(transition)
                .delay(delay)
                .duration(duration)   
                .attr("y", (d) => d.y0 + fraction * (d.y1 - d.y0))
                .on(nextOn, resolve);
               
        });
    }
    
    trans3({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            
            this.gText
                .transition(transition)
                .delay(delay)
                .duration(duration)   
                .attr("opacity", (d) => d.o1 + fraction * (d.o2 - d.o1))
                .on(nextOn, resolve);
               
        });
    }

    trans4({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            
            this.gText
                .transition(transition)
                .delay(delay)
                .duration(duration)   
                .attr("opacity", (d) => d.o2 + fraction * (0 - d.o2))
                .attr("x", (d) => d.x0 + fraction * this.config.dx)
                .attr("y", (d) => d.y1 + fraction * this.config.dy)
                .style("font-size", (d) => d.fontSize - fraction) 
                .on(nextOn, resolve);
               
        });
    }
}


























class CfnFosConsumptionAreaRegion {
    constructor(svg, data, config) {
        this.svg = svg;
        this.data = data;
        this.config = config;
        this.svgG = this.svg.append('g');
        
        this.svgG.attr('id', this.config.id);
        
        
        this.initPaths();
        // We don't want to perform initTransform at the very start of the script, but it only needs to happen once
        this.initTransformDone = false;
    }
    
    areaGenerator(x, y0, y1) {
      return d3.area()
          .x((d) => d[x])
          .y0((d) => d[y0])
          .y1((d) => d[y1])
          .curve(this.config.curve ? this.config.curve : d3.curveMonotoneX);
    }

    initPaths() {
        // It's a path so we append a path and add .datum. Instead of adding .data and then enter() and then append().
        this.gFosConsumptionAreaRegion = this.svgG
            .append('path')
            .datum(this.data)
            .attr("class", "consumption-area");
    }
    
    initTransform() {
        if (!this.initTransformDone) {
            this.gFosConsumptionAreaRegion
                .attr("stroke", "none")
                .attr("fill", this.config.fill)
                .attr("fill-opacity", 0)
                .attr("d", this.areaGenerator("x1", "y1_f", "y1_c"));
            
            this.initTransformDone = true;
        }
    } 
    
    trans1({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            this.gFosConsumptionAreaRegion
                .transition(transition)
                .delay(delay)
                .duration(duration)
                .attr("fill-opacity", 0.5)
                .on("end", resolve);
        });
    }

    trans2({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            this.gFosConsumptionAreaRegion
                .transition(transition)
                .delay(delay)
                .duration(duration)
                .attr("fill-opacity", 0)
                .on("end", resolve);
        });
    }
    

}































class CfnFosPath2Region {
    constructor(svg, data, config) {
        this.svg = svg;
        this.data = data;
        this.config = config;
        this.svgG = this.svg.append('g');
        
        this.svgG.attr('id', this.config.id);
        
        this.dataLength = data.length;
        this.pathLength = 0;
        
        this.initPaths();
        // We don't want to perform initTransform at the very start of the script, but it only needs to happen once
        this.initTransformDone = false;
    }
    
    lineGeneratorInitial(x, y) {
      return d3.line()
          .x((d) => d[x])
          .y((d) => d[y])
          .curve(this.config.curve ? this.config.curve : d3.curveMonotoneX);
    }
    
    
    lineGenerator(xFrom, xTo, yFrom, yTo, fraction = 0) {
      return d3.line()
          .x((d) => d[xFrom] + (d[xTo] - d[xFrom]) * fraction)
          .y((d) => d[yFrom] + (d[yTo] - d[yFrom]) * fraction)
          .curve(this.config.curve ? this.config.curve : d3.curveMonotoneX);
    }
    
    initPaths() {
        // It's a path so we append a path and add .datum. Instead of adding .data and then enter() and then append().
        this.gFosPath2Region = this.svgG
            .append('path')
            .datum(this.data);
    }
    
    initTransform() {
        if (!this.initTransformDone) {
            this.gFosPath2Region
                .attr("fill", "none")
                .attr("stroke", this.config.stroke)
                .attr("stroke-width", 0.3)
                .attr("d", this.lineGeneratorInitial("x1", "y1"));
            
            this.pathLength = this.gFosPath2Region.node().getTotalLength();
            
            this.gFosPath2Region
                .attr("stroke-dasharray", this.pathLength + " " + this.pathLength)
                .attr("stroke-dashoffset", -this.pathLength); // - because it draws from the end
            
            this.initTransformDone = true;
        }
    } 
    
    transDown1({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            this.gFosPath2Region
                .transition(transition + 'part1')
                .delay(delay)
                .duration(duration) 
                .attr("stroke-dashoffset", 0)
                .transition(transition + 'part2')
                .attr("stroke-dasharray", "none")
                .on(nextOn, resolve);
        });
    }
    
    transUp1({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            this.gFosPath2Region
                .transition(transition)
                .duration(duration) 
                .delay(delay)
                .attr("stroke-dasharray", this.pathLength + " " + this.pathLength)
                .attr("stroke-dashoffset", -this.pathLength)
                .on(nextOn, resolve);
        });
    }
    
    trans2({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            this.gFosPath2Region
                .transition(transition)
                .style('opacity', (d) => 1 - fraction)
                .on(nextOn, resolve);
        });
    }

}































class CfnFosPathRegion {
    constructor(svg, data, config) {
        this.svg = svg;
        this.data = data;
        this.config = config;
        this.svgG = this.svg.append('g');
        
        this.svgG.attr('id', this.config.id);
        
        this.dataLength = data.length;
        this.pathLength = 0;
        
        this.initPaths();
        // We don't want to perform initTransform at the very start of the script, but it only needs to happen once
        this.initTransformDone = false;
    }
    
    lineGeneratorInitial(x, y) {
      return d3.line()
          .x((d) => d[x])
          .y((d) => d[y])
          .curve(this.config.curve ? this.config.curve : d3.curveMonotoneX);
    }
    
    lineGenerator(xFrom, xTo, yFrom, yTo, fraction = 0) {
      return d3.line()
          .x((d) => d[xFrom] + (d[xTo] - d[xFrom]) * fraction)
          .y((d) => d[yFrom] + (d[yTo] - d[yFrom]) * fraction)
          .curve(this.config.curve ? this.config.curve : d3.curveMonotoneX);
    }
    
    mapRange(input) {
        if (input >= 0 && input <= 0.1) {
            // Map from 0 to 0.1 -> 0 to 1
            return input * 10; // Scale the input
        } else if (input > 0.1 && input <= 0.9) {
            // Map from 0.1 to 0.9 -> 1
            return 1;
        } else if (input > 0.9 && input <= 1) {
            // Map from 0.9 to 1 -> 1 to 0
            return (1 - input) * 10; // Reverse scale for the input
        } else {
            // Out of range input
            return undefined; // Or handle as needed
        }
    }
    
    initPaths() {
        // It's a path so we append a path and add .datum. Instead of adding .data and then enter() and then append().
        this.gFosPathRegion = this.svgG
            .append('path')
            .datum(this.data);
    }
    
    initTransform({transition, duration, delay, speedUp, fraction, nextOn}) {
        if (!this.initTransformDone) {
            this.gFosPathRegion
                .attr("fill", "none")
                .attr("stroke", this.config.stroke)
                .attr("stroke-width", 0.3)
                // .attr("d", this.lineGenerator("x1", "y1"))
                .attr("d", this.lineGeneratorInitial("x1", "y1"));
            
            this.pathLength = this.gFosPathRegion.node().getTotalLength();
            
            this.gFosPathRegion
                .attr("stroke-dasharray", this.pathLength + " " + this.pathLength)
                .attr("stroke-dashoffset", -this.pathLength); // - because it draws from the end
            
            this.initTransformDone = true;
        }
    } 
    
    transDown1({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            this.gFosPathRegion
                .transition(transition)
                .delay(delay)
                .duration(duration) 
                .attr("stroke-dasharray", "none")
                .attr("stroke-dashoffset", 0)
                .on(nextOn, resolve);
        });
    }
    
    transUp1({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            this.gFosPathRegion
                .transition(transition)
                .duration(duration) 
                .delay(delay)
                .attr("stroke-dasharray", this.pathLength + " " + this.pathLength)
                .attr("stroke-dashoffset", -this.pathLength)
                .on(nextOn, resolve);
        });
    }
    
    transDown2({transition, duration, delay, speedUp, fraction, nextOn}) {
      console.log(this.config.id + ': ' + fraction);
        return new Promise(resolve => {
            this.gFosPathRegion
                .transition(transition)
                .delay(delay)
                .duration(duration) 
                .style("opacity", Math.abs(fraction * 1.5 - 0.75) + 0.25)
                .attr("d", this.lineGenerator("x1", "x1", "y1", "y3", fraction))
                .on(nextOn, resolve);
        });
    }
    
    transDown2b({transition, duration, delay, speedUp, fraction, nextOn}) {
        return new Promise(resolve => {
            this.gFosPathRegion
                .transition(transition)
                .delay(delay)
                .duration(duration) 
                .style("opacity", 1 - fraction)
                .attr("d", this.lineGenerator("x1", "x1", "y1", "y3", fraction))
                .on(nextOn, resolve);
        });
    
    }
    
    trans3({transition, duration, delay, speedUp, fraction, nextOn}) {
        var fraction2 = Math.min(fraction / 0.8, 1);

        
        return new Promise(resolve => {
            this.gFosPathRegion
                .transition(transition)
                .delay(delay)
                .duration(duration) 
                .style("opacity", Math.abs(fraction * 1.5 - 0.75) + 0.25)
                .attr("d", this.lineGenerator("x1", "x1", "y3", "y5", this.mapRange(fraction)))
                .on(nextOn, resolve);
        });
    }
    
}































